import React from 'react'

const CartComponent = ({currentCart}) => {
    console.log(currentCart);
    return (
        <div>
            {
                currentCart.map((cart)=>{
                    return <h1>{cart.avatar_url}</h1>
                })
            }

        </div>
    )
}

export default CartComponent
